DROP TABLE IF EXISTS `comunicados`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `comunicados` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `titulo` varchar(255) NOT NULL,
  `numero` int(11) DEFAULT NULL,
  `categoria` varchar(5) DEFAULT NULL,
  `descripcion` varchar(400) NOT NULL,
  `texto` text NOT NULL,
  `fecha_comunicado` date DEFAULT NULL,
  `imagen` varchar(255) NOT NULL,
  `audios` varchar(512) DEFAULT NULL,
  `pdf` varchar(255) DEFAULT NULL,
  `visibilidad` char(50) NOT NULL DEFAULT 'B',
  `slug` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `comunicados_titulo_unique` (`titulo`),
  UNIQUE KEY `comunicados_slug_unique` (`slug`),
  UNIQUE KEY `comunicados_numero_unique` (`numero`),
  KEY `visibilidad` (`visibilidad`),
  KEY `categoria` (`categoria`)
) ENGINE=InnoDB AUTO_INCREMENT=423 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

