iga, cuyo sol es la\r\nestrella Capella. De piel negra, su conformación física es muy parecida a la\r\nnuestra.\r\nSu civilización ha resuelto muy eficazmente todas las necesidades\r\nbásicas de supervivencia. Su pensamiento es capaz de crear formas físicas,\r\ntanto que sus naves las crean con el pensamiento; eso es, plasmáticamente.\r\nPor expreso deseo de la Confederación para con nosotros, Shilcars\r\nha construido un ordenador plasmático que recibe el nombre de Seiph\r\n(Servicio Estelar de Inteligencia Programada para los H), al que tenemos\r\nacceso de consulta mediante extrapolación mental. Seiph se halla ubicado\r\nen el asteroide Vesta de donde recibe la energía suficiente para su\r\nmantenimiento.\r\nShilcars nos dice que su civilización dedica una muy buena parte de\r\nsu existencia al trabajo de interiorización, y el resto para atender sus\r\npropias necesidades físicas.\r\nEn Agguniom existen colonias humanas que se han formado por las\r\ndistintas migraciones voluntarias, especialmente en los últimos cien años.\r\nEs curioso observar cómo los nuevos residentes mantienen las\r\nmismas características y costumbres que en la Tierra, especialmente en la\r\nconstrucción de sus edificios y plazas, pues han reproducido muy fielmente\r\nlas de sus lugares de origen. Así pueden leerse rótulos de calles con\r\nnombres idénticos a los de aquí, plazas públicas diseñadas del mismo\r\nmodo, árboles y plantas traídas de distintos puntos de nuestra geografía.','Barcelona 1 de octubre 2004. 10 de la noche. Reunidos 19 amigos\r\nen la terraza al aire libre y con un cielo plagado de estrellas. Durante la\r\ncomunicación, los hermanos mayores nos ofrecen un espectacular\r\navistamiento de una de sus naves.','https://via.placeholder.com/400x600.png/004455?text=molestiae','Amigos míos, buenas noches. Soy Shilcars.\r\nPertenezco a la Confederación de Mundos Habitados de la Galaxia,\r\nsoy un ser humano del mismo nivel que Sili-Nur. Soy hombre y pertenezco a\r\nuna raza de atlantes, y que de alguna forma vivimos en vuestro planeta\r\nhace ya varios miles de años.\r\nNuestra conformación física es muy parecida a la vuestra, nuestra\r\npiel es negra y nuestro comportamiento social se basa en el altruismo, la\r\nconfianza, la generosidad, la armonía y el estudio de todas aquellas\r\nparticularidades propias de una raza que ha resuelto de una forma\r\ncompleta, las necesidades básicas de supervivencia.',NULL,NULL,'2023-06-24 02:17:23','2023-08-09 03:14:30');
